import React from "react";

class Header extends React.Component {
  render() {
    return (
      <div className="flex-row-align disperse pad-2 | wide-font">
        <div className="flex-row-align">
          <div>Portal</div>
          <div className="mono-font font-size-s border-round-xs pad-025">
            Card
          </div>
        </div>
        <div className="flex-row-align gap-05">
          <div>About</div>
          <div className="box pad-05">
            <u>Save</u>
          </div>
        </div>
      </div>
    );
  }
}

export default Header;
